databaseChangeLog:
- changeSet:
    id: 1
    author: postgres
    changes:
        - createTable:
            tableName: towns
            columns:
                - column:
                    name: id
                    type: bigint
                    autoIncrement: true
                    constraints:
                        nullable: false
                        primaryKey: true
                        primaryKeyName: town_pkey
                - column:
                    name: name
                    type: varchar(50)
                    constraints:
                        nullable: false
                        unique: true
- changeSet:
    id: 2
    author: postgres
    changes:
        - createTable:
            tableName: users
            columns:
                - column:
                    name: id
                    type: bigint
                    autoIncrement: true
                    constraints:
                        nullable: false
                        primaryKey: true
                        primaryKeyName: user_pkey
                - column:
                    name: email
                    type: varchar(255)
                    constraints:
                        nullable: false
                        unique: true
                - column:
                    name: firstname
                    type: varchar(50)
                    constraints:
                        nullable: false
                - column:
                    name: lastname
                    type: varchar(50)
                - column:
                    name: town_id
                    type: bigint
                - column:
                    name: password
                    type: varchar(255)
                    constraints:
                        nullable: false
                - column:
                    name: role
                    type: varchar(50)
                    constraints:
                        nullable: false
                - column:
                    name: refresh_token
                    type: varchar(255)
                - column:
                    name: refresh_expiration
                    type: bigint
